import React, { useEffect, useState } from 'react';
import fetch_token from './fetch_token.js'; // 导入 fetch_token 函数

const App = () => {
  const username = "test07"; // 假设的用户名
  const team = "김천"; // 假设的团队名
  const [token,setToken]  = useState('');
  const [Local_token,setLocalToken]  = useState('');
  const [Local_name,setLocalName]  = useState('');
  const [Local_team,setLocalTeam]  = useState('');

  useEffect(() => {
    const getTokenInfo = async () => {
      if(username !== Local_name && team !==Local_team){
        setToken(fetch_token(username, team));
        setLocalToken(token);
        setLocalName(username);
        setLocalTeam(team);
      }
      else{
        setToken(setLocalToken);
      }

    };
    getTokenInfo(); // 调用获取 token 的函数
  }, []); // 只在组件挂载时调用

  return (
    <div>
      <h3>Information</h3>
      <p>Token: {token}</p>

      <h3>Past Events</h3>
      {/* 在这里可以添加其他的组件或逻辑来处理过去的事件 */}
    </div>
  );
};

export default App;
